    const { user, isAuthenticated } = useAuth0();

    return (
        isAuthenticated && (
            <div>
                <h5>Signed in as: {user.name}</h5>
                {/* <p>{user.email}</p> */}
                {/* {JSON.stringify(user, null, 2)} */}
            </div>
        )
    )
}

export default Profile;
